import { createAsyncThunk, createSlice } from "@reduxjs/toolkit";
import { apiInstance } from "../../API/axios";
import endPoints from "../../API/endPoints";
import { GetServiceType } from "../../types/GetServiceType";

const initialState: GetServiceType = [{
    addressId: "",
    averageRating: 0,
    categoryId: "",
    categoryName: "",
    currency: "",
    description: "",
    fixedPrice: true,
    forTime: "",
    path: "",
    price: 0,
    remoteService: true,
    sellerId: "",
    serviceCover: "",
    serviceCreatedDate: "",
    serviceId: "",
    subcategoryId: "",
    subcategoryName: "",
    title: "",
    totalReview: 0,
    wishlist: false,
    _id: "",
    sellerData: [],
    gallery: [],
    addressData: []
}]

export const getServicefilterPageAction = createAsyncThunk(
    "getServiceActionType",
    async (reqPayload: { categoryId: string, subCategoryId: string }) => {
        const getServiceResponse = await apiInstance.post(endPoints.GET_SERVICE_API
            + '?categoryId=' + `${reqPayload.categoryId}`
            + '&subcategoryId=' + `${reqPayload.subCategoryId}`).then((res) => {
                return res.data.data
            })
        return getServiceResponse;
    }
)
